function simplifyMenu(menu) {
    return {
        menus: menu.menus.map(menuSection => ({
            name: menuSection.name,
            menuGroups: menuSection.menuGroups.map(group => ({
                name: group.name,
                menuItems: group.menuItems.map(item => ({
                    name: item.name,
                    price: item.price,
                    image: item.image,
                    active: true
                }))
            }))
        }))
    };
}

// Usage
